import React from 'react';
import { Link } from 'react-router-dom';





import myImg from '../img/anirban.jpg';
import IntroImg from '../img/bg.jpg';





import "./HeroImgstyle.css";




const HeroImag = () => {
  return (
    <div className="hero">

      <div className="mask">
        <img className="into-img" src={IntroImg} alt="intoImg" />
      </div>
      <div className="content">
        <div className="my-img">
          <img className='anirban' src={myImg} alt="myImg" />
          <p>HI, I'M ANIRBAN DAS JOY.</p>
        </div>

        <h1>React Developer</h1>
        <div >
          <Link className='btn' to='/projects'>Projects</Link>
          <Link className='btn btn-light' to='/contact'>Contact</Link>
        </div>


      </div>
    </div>
  )
}

export default HeroImag
